import React from 'react';
import './css/App.css';  // Asegúrate de que App.css esté correctamente importado
import Services from './components/Services'; // Importa el componente de Servicios

function App() {
  return (
    <div className="App">
      {/* Imágenes flotantes en el fondo */}
      <div className="floating-image hammer">
        <img src="/images/hammer.png" alt="Hammer" width="100" />
      </div>
      <div className="floating-image camera">
        <img src="/images/camera.png" alt="Camera" width="100" />
      </div>
      <div className="floating-image saw">
        <img src="/images/saw.png" alt="Saw" width="100" />
      </div>
      <div className="floating-image data-symbol">
        <img src="/images/data-symbol.png" alt="Data Symbol" width="100" />
      </div>

      {/* Header */}
      <header className="header">
        <h1>ConstrudomotiK</h1>
        <p>Construcción y Domótica a tu alcance</p>
      </header>

      {/* Sección de Servicios */}
      <Services />

      {/* Footer */}
      <footer className="footer">
        <p>&copy; 2024 ConstrudomotiK - Todos los derechos reservados</p>
      </footer>
    </div>
  );
}

export default App;
